iv = "3c44b0d0672bcb37ae0ee6e91cfdff1f"

ciphertext = ""

iv_completao = iv * 65494846

iv_completao = bytes.fromhex(iv_completao)

ciphertext = bytes.fromhex(ciphertext)

def xor(a, b):
    return bytes(x^y for x, y in zip(a,b))

plaintext = xor(ciphertext, iv_completao)

with open("imagem_com_flag_bonita.png", "wb") as f:
    f.write(plaintext)
